function tabs(t){const e=document.querySelectorAll(t+" [data-tab]"),a=document.querySelectorAll(t+" [data-tab-content]");e.forEach((function(t){t.addEventListener("click",(function(c){t.classList.contains("activeb")||(e.forEach((function(t){t.classList.remove("activeb")})),t.classList.add("activeb"),a.forEach((function(t){t.classList.remove("active")})),document.querySelector("#"+c.target.dataset.tab).classList.add("active"))}))}))}tabs(".tab1");var swiper=new Swiper(".mySwiper",{effect:"flip",grabCursor:!0,pagination:{el:".swiper-pagination"},navigation:{nextEl:".feature-next",prevEl:".feature-prev"}});